processStart :: SymbolTable -> ConstantAddressMap -> IdentifierAddressMap -> VariableCounters -> QuadNum -> Expression -> (VariableCounters,[Quadruple],QuadNum)
processStart symTab constaddressMap idaddressMap (intLitC, decLitC, strLitC, boolLitC) quadNum (ExpressionLitVar (DecimalLiteral dec)) = case (Map.lookup ("<dec>" ++ (show (dec))) constaddressMap) of
                                                                                                                                            Just addressCons -> case (Map.lookup ("<int>0") constaddressMap) of
                                                                                                                                                                    Just address -> ((intLitC, decLitC + 1, strLitC, boolLitC), [(buildQuadrupleThreeAddresses quadNum ADD_ (address, addressCons, (decLitC)))], quadNum + 1)  
processStart symTab constaddressMap idaddressMap (intLitC, decLitC, strLitC, boolLitC) quadNum (ExpressionLitVar (IntegerLiteral int)) = case (Map.lookup ("<int>" ++ (show (int))) constaddressMap) of
                                                                                                                                            Just addressCons -> case (Map.lookup ("<int>0") constaddressMap) of
                                                                                                                                                                    Just address -> ((intLitC + 1, decLitC, strLitC, boolLitC), [(buildQuadrupleThreeAddresses quadNum ADD_ (address, addressCons, (intLitC)))], quadNum + 1) 
processStart symTab constaddressMap idaddressMap (intLitC, decLitC, strLitC, boolLitC) quadNum (ExpressionLitVar (StringLiteral str)) = case (Map.lookup ("<str>" ++ (str)) constaddressMap) of
                                                                                                                                            Just addressCons -> case (Map.lookup ("<str>") constaddressMap) of
                                                                                                                                                                    Just address -> ((intLitC, decLitC, strLitC + 1, boolLitC), [(buildQuadrupleThreeAddresses quadNum ADD_ (address, addressCons, (strLitC)))], quadNum + 1) 
processStart symTab constaddressMap idaddressMap (intLitC, decLitC, strLitC, boolLitC) quadNum (ExpressionLitVar (BoolLiteral bool)) = case (Map.lookup ("<bool>" ++ (show (bool))) constaddressMap) of
                                                                                                                                            Just addressCons -> case (Map.lookup ("<bool>True") constaddressMap) of
                                                                                                                                                                    Just address -> ((intLitC, decLitC, strLitC, boolLitC + 1), [(buildQuadrupleThreeAddresses quadNum EQ_ (address, addressCons, (boolLitC)))], quadNum + 1)
processStart symTab constaddressMap idaddressMap (intLitC, decLitC, strLitC, boolLitC) quadNum (ExpressionLitVar (VarIdentifier id)) = case (checkDataTypeOfLitVar (-100000000000000) (VarIdentifier id) symTab) of
                                                                                                                                            Just PrimitiveDouble -> case (Map.lookup (show (id)) idaddressMap) of
                                                                                                                                                                        Just addressCons -> case (Map.lookup ("<int>0") constaddressMap) of
                                                                                                                                                                                                Just address -> ((intLitC, decLitC + 1, strLitC, boolLitC), [(buildQuadrupleThreeAddresses quadNum ADD_ (address, addressCons, (decLitC)))], quadNum + 1)  
                                                                                                                            
                                                                                                                                            Just PrimitiveInt -> case (Map.lookup (id) idaddressMap) of
                                                                                                                                                                        Just addressCons -> case (Map.lookup ("<int>0") constaddressMap) of
                                                                                                                                                                                                Just address -> ((intLitC + 1, decLitC, strLitC, boolLitC), [(buildQuadrupleThreeAddresses quadNum ADD_ (address, addressCons, (intLitC)))], quadNum + 1) 
                                                                                                                                            Just PrimitiveInteger -> case (Map.lookup (id) idaddressMap) of
                                                                                                                                                                        Just addressCons -> case (Map.lookup ("<int>0") constaddressMap) of
                                                                                                                                                                                                Just address -> ((intLitC + 1, decLitC, strLitC, boolLitC), [(buildQuadrupleThreeAddresses quadNum ADD_ (address, addressCons, (intLitC)))], quadNum + 1)
                                                                                                                                            Just PrimitiveString -> case (Map.lookup (id) idaddressMap) of
                                                                                                                                                                        Just addressCons -> case (Map.lookup ("<str>") constaddressMap) of
                                                                                                                                                                                                Just address -> ((intLitC, decLitC, strLitC + 1, boolLitC), [(buildQuadrupleThreeAddresses quadNum ADD_ (address, addressCons, (strLitC)))], quadNum + 1)
                                                                                                                                            Just PrimitiveBool -> case (Map.lookup (id) idaddressMap) of
                                                                                                                                                                        Just addressCons -> case (Map.lookup ("<bool>True") constaddressMap) of
                                                                                                                                                                                                Just address -> ((intLitC, decLitC, strLitC, boolLitC + 1), [(buildQuadrupleThreeAddresses quadNum ADD_ (address, addressCons, (boolLitC)))], quadNum + 1)
